import React, { Component } from 'react';
import Child1 from './Child';
class App extends Component {
  componentDidMount(){
  }
  constructor(props){
    super(props)
    this.state = {'count':0}
  }
  handleClick = () => {
    var temp_count = this.state.count
    this.setState({'count': temp_count + 1})
  }
  render() {
    return (
    <svg width="1500" height="1500">
      <svg x = "0" width = "200" height = "200">
        <line x1="0" y1="0" x2 = "150" y2="150" stroke="red" stroke-width="2"> </line>
      </svg>
      <svg x="200" width="200" height="200">
        <rect x="10" y="10" width={100} height={100} fill='red' stroke='black' stroke-width="2" rx='10' ry='10'></rect>
      </svg>
      <svg x="400" width="100" height="100">
        <circle cx="50" cy="50" r='40' width={100} height={100} fill='red' stroke='black' stroke-width="2"></circle>
      </svg>
      <svg x="600" width="200" height="200">
        <path d = "M 10 10 L 50 50 H 100 V 150 L 10 150 Z" fill="none" stroke = "black" stroke-width="2"> </path>
      </svg>
      <svg x="800" width="200" height="100">
        <text x='10' y='50' font-family="Arial" font-size="24" fill='blue' textAnchor='start'> Styled Text </text>
      </svg>
      <svg x='1000' width = '200' height = '100'>
      <line x1='100' y1='0' x2='100' y2='200' stroke='red' strokeDasharray={'5,5'}></line>
        <text x='100' y='20' textAnchor='start' stroke='black' fill='black'>Start</text>
        <text x='100' y='50' textAnchor='middle' stroke='black' fill='black'>middle</text>
        <text x='100' y='80' textAnchor='end' stroke='black' fill='black'>end</text>
      </svg>
      <svg width="200" height="200">
        <text x="100" y="100" transform="rotate(45, 100, 100)">Rotated Text</text>
      </svg>
      <svg width="200" height="200">
      <g fill="blue" transform="translate(50,50)">
        <rect x="0" y="0" width="50" height="50"/>
          <circle cx="75" cy="25" r="25"/>
        </g>
      </svg>
      </svg>);
  }
}

export default App;
